import React from 'react';
import Header_main from './components/Header_main'

function App() {
  return (
    <main >
      <aside>
        <Header_main/>
      </aside>
    
      <div class="content">
        <div class="news-header">
          <img  src="/img/logo.jpeg"/>
          <h1>Новости</h1>
        </div>
      </div>


      

      
    </main>
  );
  
}

export default App;
